measurements.description:
Four flowers crowded on a 27.1-cm inflorescence; dorsal sepal chartreuse,
	striped mahogany, diffuse centrally; synsepal chartreuse, striped mahogany; 
	petals hirsute edges, chartreuse, mahogany spots basally, fusing to dark mahogany distally; 
	pouch charteuse, partially overlaid light brown; staminode light yellow, 
	mahogany sides, canescent; substance firm; texture matte.
